import React from 'react';
import './App.css';
import Hero from './components/hero/Hero';
import About from './components/about/About';
import Portfolio from './components/portfolio/Portfolio';


function App() {
  return (
    <div className="App">
      <Hero />
      <div>
      <About />
      <Portfolio />
        <h1>Work Experience</h1>
      </div>
    </div>
  );
}

export default App;
